import { ExportVideoPlugin } from "./ExportVideoPlugin.js";
export async function loadExportVideoPlugin(engine, refresh = true) {
    engine.checkVersion("3.8.1");
    await engine.addPlugin(new ExportVideoPlugin(engine), refresh);
}
